import 'bootstrap/dist/css/bootstrap.min.css';
import Counting from "./Counting";

function Joke() {
    const QUO = Math.floor(1000/7);

    const [isGhoul, setIsGhoul] = useState(false);
    const [counts, setCounts] = useState(1000);
    const [components, setComponents] = useState([]);

    useEffect(() => {
        if(isGhoul && counts - 7 > 0)
            setTimeout(() => {
                let newArray = Object.assign([], components);
                newArray.push(counts.toString() + ' - 7 = ' + counts-7 + '" />')
                setComponents(newArray);
                setCounts(counts-7)
            }, 500);
    });


   return(
        <div className={'container'}>
            <button onClick={() => {
                setIsGhoul(true);
            }}>
                Я гуль :(
            </button>
            { components }
        </div>
    )
}



